import { BrowserRouter, Route, Switch, Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <h1> Pokedex </h1>
          <Link to=''>Home</Link>
          <Link to=''>About</Link>
          <Link to=''>Favorite Pok√©mons</Link>
      <BrowserRouter>
        <Switch>

          <Route path='/'><Pokedex pokemons={pokemons} /></Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
